







drop table if exists tmptprijs;
create table tmptprijs as 
select 
		ta.transactieid as transactieid, sum(a.prijs) as prijstotaal 
		from transactieartikel as ta 
		inner join artikel as a on ta.artikelid=a.artikel_id
		group by ta.transactieid
;
update transactie set totaalbedrag = (select prijstotaal from tmptprijs where tmptprijs.transactieid=transactie.transactie_id);
drop  table tmptprijs;


